 column is hidden. Please enable it in the Screen Options to bulk-edit image sources.'=>'Kolumna źródła obrazka jest ukryta. Włącz ją w „Opcjach ekranu”, aby zbiorczo edytować źródła obrazków.','The index is rebuilt automatically when a page with images on it is visited in the frontend.'=>'Indeks zostanie automatycznie przebudowywany po odwiedzeniu w interfejsie użytkownika strony zawierającej obrazek.','The indexer is outdated. The last check was more than %s days ago.'=>'Nieaktualny indeks. Ostatnie indeksowanie przeprowadzono ponad %s dni temu.','The list only shows the last %d images.'=>'Liczba wyświetlanych obrazków na liście: %d.','The number of entries before a pagination is added.'=>'Liczba wpisów przed podziałem na strony. Użyj 0, aby wyświetlić wszystkie wpisy na jednej stronie.','The table below shows the number of indexed published posts.'=>'Poniższa tabela pokazuje liczbę zindeksowanych opublikowanych wpisów.','There are no activations left.'=>'Nie ma już żadnych aktywacji.','There is a new version of %1$s available.'=>'Nowa wersja %1$s jest dostępna.','There might be a new version of %1$s. Please <strong>provide a valid license key</strong> in order to receive updates and support <a href="%2$s">on this page</a>.'=>'Może być nowa wersja %1$s. Proszę <strong>podaj prawidłowy klucz licencyjny</strong>, aby otrzymywać aktualizacje i wsparcie <a href="%2$s">na tej stronie</a>.','They take up at least %s in disk space on your server.'=>'Zajmują co najmniej %s miejsca na dysku twojego serwera.','This index is used to generate the Global List.'=>'Ten indeks jest używany do generowania listy ogólnej.','This index is used to generate the Per-post List.'=>'Ten indeks jest używany do generowania listy „Na wpis”.','This is not the correct key for this plugin.'=>'Niepoprawny klucz dla tej wtyczki.','Thomas Maier'=>'Thomas Maier','Thumbnail'=>'Miniaturka','Title'=>'Tytuł','Tools'=>'Narzędzia','unchecked'=>'niesprawdzone','Unstyled credit line below the image'=>'Źródł