vations in %1$syour account%2$s.'=>'Aktywacjami możesz zarządzać na %1$swoim koncie%2$s.','You can show a list with all images and sources from your Media library. Just place the shortcode %s on any page.'=>'Możesz wyświetlić listę ze wszystkimi obrazkami i ich źródłami z biblioteki multimediów. Wystarczy umieścić krótki kod %s na dowolnej stronie.','You do not have permission to install plugin updates'=>'Nie masz uprawnień do aktualizacji wtyczek','Your current settings show the standard source by default when the individual image source is missing.'=>'Bieżące ustawienia domyślnie wyświetlają źródło standardowe, gdy brakuje źródła obrazka ustawionego dla konkretnego pliku.','Your feedback shapes %1$s since %2$d'=>'Twoja opinia kształtuje %1$s od %2$d','Your license expired.'=>'Twoja licencja wygasła.']];
